async function exportTableToBase64(tableName, json, subpath) {
	return db
		.table(tableName)
		.toArray()
		.then((records) => {
			records = records.slice(8, 10);
			if (subpath) {
				records = records.map((record) => {
					record = record[subpath];
					return record;
				});
			}
			const jsonString = replaceSpecialCharToHex(JSON.stringify(records));
			

			if (json) {
				return jsonString;
			}
			const base64String = btoa(jsonString);
			return base64String;
		})
		.catch((error) => {
			console.error(`Error al exportar la tabla ${tableName}:`, error);
		});
}

function replaceSpecialCharToHex(str) {
	return str
		.replace(/á/g, "##a##")
		.replace(/é/g, "##e##")
		.replace(/í/g, "##i##")
		.replace(/ó/g, "##o##")
		.replace(/ú/g, "##u##")
		.replace(/ñ/g, "##n##")
		.replace(/Á/g, "##A##")
		.replace(/É/g, "##E##")
		.replace(/Í/g, "##I##")
		.replace(/Ó/g, "##O##")
		.replace(/Ú/g, "##U##")
		.replace(/Ñ/g, "##N##")
		.replace(/ü/g, "##u2##")
		.replace(/Ü/g, "##U2##");
}

function replaceHexToSpecialChar(str) {
	return str
		.replace(/##a##/g, "á")
		.replace(/##e##/g, "é")
		.replace(/##i##/g, "í")
		.replace(/##o##/g, "ó")
		.replace(/##u##/g, "ú")
		.replace(/##n##/g, "ñ")
		.replace(/##A##/g, "Á")
		.replace(/##E##/g, "É")
		.replace(/##I##/g, "Í")
		.replace(/##O##/g, "Ó")
		.replace(/##U##/g, "Ú")
		.replace(/##N##/g, "Ñ")
		.replace(/##u2##/g, "ü")
		.replace(/##U2##/g, "Ü");
}

// Función para verificar si una tabla está vacía o no existe
function isTableEmptyOrNotExist(tableName) {
	const tableExists = db.tables.some((table) => table.name === tableName);
	if (!tableExists) {
		return Promise.resolve(true);
	} else {
		return db
			.table(tableName)
			.count()
			.then((count) => count === 0)
			.catch((error) => {
				console.error(
					`Error al contar los registros de la tabla ${tableName}:`,
					error
				);
				return true;
			});
	}
}

// Función para importar datos a una tabla desde una cadena base64
async function importTableFromBase64(tableName, base64Data, deleteAll = false) {
	if (deleteAll) {
		await db.table(tableName).clear();
	}

	const importFunc = (isEmpty) => {
		if (isEmpty) {
				const jsonString = atob(base64Data);
				const records = JSON.parse(replaceHexToSpecialChar(jsonString));
				return db.table(tableName).bulkAdd(records);
			} else {
				return Promise.resolve();
			}
	}

	return isTableEmptyOrNotExist(tableName)
		.then(importFunc)
		.catch((error) => {
			console.error(`Error al importar datos a la tabla ${tableName}:`, error);
		});
}










